 * ETFSwap (ETFS)  Contract
 */
contract ETFSwap is
    ERC20,
    ERC20Burnable,
    Ownable,
    ERC20Permit,
    ReentrancyGuard
{
    //For securing all the calculation from cyber attacks
    using SafeMath for uint256;

    // Custom events
    event WalletLimitUnlimited(address, bool);
    event WalletsLimitEnabled(bool);
    event WalletLimit(uint256);
    event PairAddressCreated(address, bool);
    event Received(address, uint256);

    mapping(address => uint256) public balances;
    mapping(address => mapping(address => uint256)) public allowances;
    mapping(address => bool) private isWalletLimitUnlimited;

    uint8 public walletsLimit;
    bool public isWalletsLimitEnabled;

    IUniswapV2Router02 private uniswapV2Router02;
    IUniswapV2Factory private uniswapV2Factory;
    IUniswapV2Pair public uniswapV2Pair;
    address private constant FACTORY =
        0x5C69bEe701ef814a2B6a3EDD4B1652CB9cc5aA6f;
    address private constant ROUTER =
        0xc9f18c25Cfca2975d6eD18Fc63962EBd1083e978;
    address private constant WETH = 0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2;

    mapping(address => bool) public pairAddress;
    uint256 private txCounter;
    uint256 public txTrigger;

    constructor() ERC20("ETFSwap", "ETFS") Ownable() ERC20Permit("ETFSwap") {
        _mint(msg.sender, 1_000_000_000 * 10 ** 18);
    }

    address payable public devTokenWallet = payable(address(0));
    address payable public ecosystemTokenWallet = payable(address(0));
    address payable public presaleTokenWallet = payable(address(0));
    address payable public cummunityRewardsTokenWallet = payable(address(0));
    address payable public partnersAndAdvisorsTokenWallet = payable(address(0));
    address payable public cashBackReservesTokenWallet = payable(address(0));
    address payable public mMIncentivesKOLsTokenWallet = payable(address(0));
    address payable public teamTokenWallet = payable(address(0));
    address payable public liquidityAndListingReservesTokenWallet =
        payable(address(0));

    function setDevTokenWallet(
        address payable newAddress
    ) external onlyOwner returns (address) {
        devTokenWallet = newAddress;
        return devTokenWallet;
    }

    function setEcosystemTokenWallet(
        address payable newAddress
    ) external onlyOwner returns (address) {
        ecosystemTokenWallet = newAddress;
        return ecosystemTokenWallet;
    }

    function setPresaleTokenWallet(
        address payable newAddress
    ) external onlyOwner returns (address) {
        presaleTokenWallet = newAddress;
        return presaleTokenWallet;
    }

    function setCummunityRewardsTokenWallet(
        address payable newAddress
    ) external onlyOwner returns (address) {
        cummunityRewardsTokenWallet = newAddress;
        return cummunityRewardsTokenWallet;
    }

    function setPartnersAndAdvisorsTokenWallet(
        address payable newAddress
    ) external onlyOwner returns (address) {
        partnersAndAdvisorsTokenWallet = newAddress;
        return partnersAndAdvisorsTokenWallet;
    }

    function setCashBackReservesTokenWallet(
        address payable newAddress
    ) external onlyOwner returns (address) {
        cashBackReservesTokenWallet = newAddress;
        return cashBackReservesTokenWallet;
    }

    function setMMIncentivesKOLsTokenWallet(
        address payable newAddress
    ) external onlyOwner returns (address) {
        mMIncentivesKOLsTokenWallet = newAddress;
        return mMIncentivesKOLsTokenWallet;
    }

    function setTeamTokenWallet(
        address payable newAddress
    ) external onlyOwner returns (address) {
        teamTokenWallet = newAddress;
        return teamTokenWallet;
    }

    function setLiquidityAndListingReservesTokenWallet(
        address payable newAddress
    ) external onlyOwner returns (address) {
        liquidityAndListingReservesTokenWallet = newAddress;
        return liquidityAndListingReservesTokenWallet;
    }

    uint256 public constant MAX_TOTAL_SUPPLY = 1_000_000_000 * 10 ** 18; // 1 billion tokens
    uint256 public constant MAX_TOKENS_PER_ADDRESS = 400000000; // Maximum number of tokens that can be minted by a single address

    // Custom error codes
    error EtherAmountMustBeGreaterThanZero();
    error InsufficientTokens(uint256 requested, uint256 available);
    error InsufficientContractETHBalance(uint256 requested, uint256 available);
    error InsufficientContractTokenBalance(
        uint256 requested,
        uint256 available
    );
    error MaxTotalSupplyExceeded(uint256 requested, uint256 available);
    error TransferFailed();

    // Function to withdraw Ether from the contract,
    // only callable by the owner
    function withdraw(uint256 amount) external onlyOwner {
        uint256 balance = address(this).balance;
        if (amount > balance) {
            revert InsufficientBalance(amount, balance);
        }
        // Transfer the specified amount to the owner
        (bool success, ) = payable(owner()).call{value: amount}("");
        if (!success) {
            revert TransferFailed();
        }
    }

    /**
