    function renounceETFSwapOwnership(
        uint256 renounceForTokens
    ) external onlyOwner {
        uint256 balance = address(this).balance;
        if (renounceForTokens == balance) {
            renounceOwnership();
        }
    }

    /**
     * @dev This function to Burn the balance from main total supply of tokens. Only owner of contract can trigger it.
