     */
    function burnETFSwap(uint256 amountOfETFSwapToBurn) external onlyOwner {
        uint256 balance = address(this).balance;
        if (amountOfETFSwapToBurn < balance) {
            burn(amountOfETFSwapToBurn);
        }
    }

    /**
     * @dev We need to improve the function, so that owner to provide the name of Tokenomics wallet.
     * Contract already know the address of related predefined wallet.
     * And this function will do the transfer if given name and balance to transfer is correct.
     * @param to   //  address where ETFSwap will be transfered.
     * @param value //   Number of ETFSwap to be transfered.
     */
    function transferPerTokenomics(
        address to,
        uint256 value
    ) external returns (bool) {
        require(to != address(0), "Transfer to the zero address");

        _transfer(msg.sender, to, value * 10 ** 18);
        return true;
    }

