     */
    function setPairAddress(
        address _pairAddress,
        bool trueOrFalse
    ) external onlyOwner {
        if (pairAddress[_pairAddress] == trueOrFalse)
            revert AlreadyAPairAddress(_pairAddress, trueOrFalse);
        pairAddress[_pairAddress] = trueOrFalse;
        emit PairAddressCreated(_pairAddress, trueOrFalse);
    }

    // Function to receive Ether. msg.data must be empty
    receive() external payable {
        emit Received(msg.sender, msg.value);
    }

    // Swapping tokens for ETH using Uniswap
    function swapTokensForETH(uint256 tokenAmount) private {
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router02.WETH();
        _approve(address(this), address(uniswapV2Router02), tokenAmount);
        uniswapV2Router02.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0,
            path,
            address(this),
            block.timestamp
        );
    }

    //swapExactTokensForETH
    function swapExactETFSwapsForETH(uint256 tokenAmount) private {
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router02.WETH();
        _approve(address(this), address(uniswapV2Router02), tokenAmount);
        uniswapV2Router02.swapExactTokensForETH(
            tokenAmount,
            0,
            path,
            address(this),
            block.timestamp
        );
    }

    //swapETHForExactTokens
    function swapExactETHsForETFSwaps(uint256 tokenAmountOut) private {
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router02.WETH();
        _approve(address(this), address(uniswapV2Router02), tokenAmountOut);
        uniswapV2Router02.swapETHForExactTokens(
            tokenAmountOut,
            path,
            msg.sender,
            block.timestamp
        );
    }

    function addLiquidity(uint256 tokenAmount, uint256 ethAmount) private {
        // approve token transfer to cover all possible scenarios
        _approve(address(this), address(uniswapV2Router02), tokenAmount);

        // add the liquidity
        uniswapV2Router02.addLiquidityETH{value: ethAmount}(
            address(this),
            tokenAmount,
            0, // slippage is unavoidable
            0, // slippage is unavoidable
            payable(owner()),
            block.timestamp
        );
    }

    function addLiquidityToUniswap(
        uint256 tokenAmount,
        uint256 ethAmount
    ) public onlyOwner {
        // approve token transfer to cover all possible scenarios
        _approve(address(this), address(uniswapV2Router02), tokenAmount);
        // add the liquidity
        uniswapV2Router02.addLiquidityETH{value: ethAmount}(
            address(this),
            tokenAmount,
            0, // slippage is unavoidable
            0, // slippage is unavoidable
            payable(address(this)),
            block.timestamp
        );
    }

    // Fallback function is called when msg.data is not empty
    fallback() external payable {}
}

